import axios from "axios";
import { openDB, deleteDB, wrap, unwrap } from "idb";

export default class ImageDatabase {
  static getImage(url) {
    if (navigator.onLine) {
      console.log("nav online");
      // online, download images since we can
      // console.log("image method", this.getImageFromUrl(url));
      // console.log(
      //   "image method",
      //   this.getImageFromUrl(url).then(function(imageString) {
      //     return imageString;
      //   })
      // );
      return this.getImageFromUrl(url).then(function(imageString) {
        if (typeof imageString == "undefined") {
          console.log("imageString was undefined!!!");
        } else {
          console.log("image string was", imageString);
        }
        ImageDatabase.updateDatabase(imageString, url);
        return imageString;
      });
      // put this new image into the DB too
    } else {
      // offline, see if image in DB else get the defautl offline image
      console.log("nav offline");
      return this.getImageFromDatabase(url).then(function(image) {
        if (typeof image !== "undefined") {
          return image;
        } else {
          return ImageDatabase.loadNoInternetPhoto();
        }
      });
    }
  }

  static getImageFromUrl(url) {
    // gets an image in base64, returns a promise
    return axios
      .get(url, {
        responseType: "arraybuffer"
      })
      .then(function(response) {
        console.log(response);
        var buf = new Buffer(response.data, "binary").toString("base64");
        console.log("buf", buf);
        return buf;
      })
      .catch(function(error) {
        console.log(error);
      });
  }

  static updateDatabase(url, imageString) {
    //put this new item into the DB if we got it from the internet
    var request = indexedDB.open("MyTestDatabase", 4);

    request.onerror = function(event) {
      // db.onerror rather than request.onerror since higher level, bubbles up...
      console.log("Why didn't you allow my web app to use IndexedDB?!");
    };

    request.onsuccess = function(event) {
      var db = event.target.result;
      console.log("successfully accessed DB", db);
      doTransaction(db);
    };

    request.onupgradeneeded = function(event) {
      var db = event.target.result;

      // Create another object store called "names" with the autoIncrement flag set as true.
      db.createObjectStore("images");
      console.log("got to upgrade needed", db);
    };

    function doTransaction(db) {
      var transaction = db.transaction("images", "readwrite");
      var objectStore = transaction.objectStore("images");
      var request = objectStore.get(url);
      request.onsuccess = function(event) {
        console.log(
          "successfully pulled something from DB, OR null if not already there"
        );
        if (event.target.result) {
          //object already exists
          event.target.update(imageString);
        } else {
          // object doesn't exist
          // note, swapped key/value argument positions
          // as opposed to docs, as this gives the right
          // format in the application tab of devtools in chrome?
          objectStore.add(url, imageString);
        }
      };
      request.onerror = function(event) {
        console.log("Error in DB logic");
      };
    }
  }

  static getImageFromDatabase(url) {
    var dbPromise = openDB("MyTestDatabase", 4, function(upgradeDb) {
      console.log("making a new object store");
      if (!upgradeDb.objectStoreNames.contains("images")) {
        upgradeDb.createObjectStore("images");
      }
    });
    return dbPromise.then(function(db) {
      var tx = db.transaction("images", "readwrite");
      var imagesOS = tx.objectStore("images");
      return imagesOS.get(url);
    });
  }
  static loadNoInternetPhoto() {
    // returns a base64 image for displaying when no internet + image not cached
    var image =
      "";
    return image;
  }
}
